        <Link to="/book/2">Book 2 <br/> </Link> <br/>
        <Link to="/book/3">Book 3 <br/> </Link> <br/>
        <Outlet context={{obj:"Router App"}}/>
        <input type="number" value={number} onChange={e=> setnumber(e.target.value)}/>
        </>
    )}
